

def find_max(arr):
    maximum = 0
    for i in arr:
        if i > maximum:
            maximum = i
    return maximum
def minSetSize(arr):
        hash = {}
        array_length = len(arr)
        size_required = array_length // 2
        for i in arr:
            if i not in hash:
                hash[i] = 1
            else:
                hash[i] += 1
        sizes_array = []
        for k in hash:
            sizes_array.append(hash[k])
        set_size = 0
        size_set = 0
        while size_required > size_set:
            maxi = max(sizes_array)
            index = sizes_array.index(maxi)
            size_set += maxi
            sizes_array.pop(index)
            set_size += 1
        return set_size
        
        


